import React from 'react';

import styles from './../Style/Components/Servers.module.css';

//Modules 
import Server from './Server';

type MyState = { Active: number, };
class Servers extends React.Component<MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Active: 123,
      Servers: new Map([
        [ 123, 'Testing' ]
      ]) 
    };
  }
  render() {
    return (
      <div role="button" className={styles.Container}>
        {
          this.state.Active && <div className={styles.Active}></div>
        }
        <picture className={styles.Icon}>
          <img className={styles.Icon_IMG} src={this.state.Picture} />
        </picture>
      </div>
    );
  }
}

export default Servers;
